  "title": {
    "nb": "Antall nye arbeidsforhold 2017"
  },
  "description": {
    "nb": "Rapportering av lønns- og ansettelsesforhold til Skatteetaten, NAV og Statistisk sentralbyrå (SSB) er samlet i a-meldingen og skal sendes inn hver måned av alle som utbetaler lønn, pensjon og andre ytelser. A-meldingen inneholder opplysninger om lønn og ytelser, i tillegg til status på alle arbeidsforhold som lagres i Arbeidstaker- og arbeidsgiverregisteret (Aa-register). Lovgrunnlag for registrering av arbeidsforhold er a-opplysningsloven og folketrygdloven.Statistikken over antall nye arbeidsforhold viser antall arbeidsforhold som var nye en måned og som ikke var registrert måneden før. En person kan flere arbeidsforhold på samme tid, antall arbeidsforhold er derfor større enn antall sysselsatte. Data er fordelt på arbeidssted (kommune), næring , sektor og yrke. Data fra Aa-register er begrenset til kun å inneholde arbeidsforhold med mer en 1 times arbeid per uke (målt i måneden etter oppstart), kun data fra ny A-ordning, kun data for Norge og ikke permisjoner. Statistikk med antall nye arbeidsforhold under 4 er maskert med *. Data kan kobles med andre datasett fra NAV som inneholder yrke og med nasjonale kodestandarder for næringsgruppering (NACE) og yrkeskoder (STYRK)."
  },
