  },
  "description": {
    "nb": "NAVs bedriftsundersøkelse ser på hvilke forventninger bedriftene har i forhold til sysselsettingsutviklingen det kommende året, om bedriftene har mislyktes i å rekruttere arbeidskraft de siste tre månedene og om dette skyldes for få kvalifiserte søkere på stillingene. På bakgrunn av disse svarene estimeres mangel på arbeidskraft for landet som helhet, for ulike regioner, samt enkeltnæringer og for ulike yrker. Undersøkelsen er årlig. Rapport i pdf- og xls-format publiseres på nav.no sine analysesider under Bedriftsundersøkelsen. Data presenteres i tre datasett for estimert mangel for yrke, næring og fylke. Dette datasettet inneholder estimert mangel på arbeidskraft i antall personer etter fylke"
